import React from "react";
import "./Home.sass";
import Banner from "./Banner/Banner";

const Home = () => {
  return (
    <>
      <div className="inner">
        <div className="container_home_main">
          <Banner />
        </div>
      </div>
    </>
  );
};

export default Home;
